// RowPopup.js
import React from "react";

const RowPopup = ({ rowData }) => {
  return (
    <div>
      {/* Display each property of the rowData object */}
      {Object.entries(rowData).map(([key, value]) => (
        <div key={key}>
          <strong>{key}:</strong> {value}
        </div>
      ))}
    </div>
  );
};

export default RowPopup;
